import React from "react";

function Food({name, image}) {
  return (
    <div>
      <h1>I like {name}</h1>
      <img src={image} alt=""/>
    </div>)
      ;
}

const foodILike = [
  {
    name:"ramen",
    image: "https://upload.wikimedia.org/wikipedia/commons/thumb/d/dc/Shoyu_Ramen.jpg/1200px-Shoyu_Ramen.jpg"
  },
  { 
    name: "kimbap",
    image: "https://www.seriouseats.com/thmb/o94pqlhYlIMrT3KFLIPhs09chDo=/1500x1125/filters:fill(auto,1)/__opt__aboutcom__coeus__resources__content_migration__serious_eats__seriouseats.com__2020__01__20200122-gimbap-vicky-wasik-24-f5ed1075f35846a29e0812ee053a1bf8.jpg"  
  },
  {
    name: "sushi",
    image: "https://rimage.gnst.jp/livejapan.com/public/article/detail/a/00/00/a0000881/img/basic/a0000881_main.jpg"
  }
]

function renderFood(dish){
  return <Food name={dish.name} image={dish.image} />
}

function App() {
    return (
    <div> 
      {foodILike.map(renderFood)}
    </div> 
    );
}

export default App;
